character = {}

function onLoad()
  if self.script_state ~= "" then character = JSON.decode(self.script_state) end
  Wait.condition(
    function()
      for id, value in pairs(character) do
        self.UI.setAttributes(id, { text = value, isOn = value })
      end
      if character["image-url"] and character["image-url"] ~= "" then
        self.UI.setAttributes("portrait", {
          image = "portrait-"..character["image-url"],
          color = "white"
        })
      end
    end,
    function() return self.UI.getXml() ~= "" end
  )
end

function onSave()
  self.script_state = JSON.encode(character)
end

function onFieldEndEdit(_, value, id)
  character[id] = value
  self.UI.setAttributes(id, { text = value })
end

function onToggleValueChanged(_, value, id)
  character[id] = value
  self.UI.setAttributes(id, { isOn = value })
end

function onNudgeClick(_, button, id)
  local coef
  if button == "-1" then
    coef = 1
  elseif button == "-2" then
    coef = 5
  else return end
  local nudge, dir, amount = id:match("^([%a%-]+)([%+%-])(%d+)$")
  local offset = tonumber(amount) * coef
  if dir == "-" then offset = offset * -1 end

  local value = (tonumber(character[nudge]) or 0) + offset
  character[nudge] = value
  self.UI.setAttributes(nudge, { text = value })
end

function onImageUrlEndEdit(_, value, id)
  onFieldEndEdit(_, value, id)

  Wait.time(function()
    self.UI.setCustomAssets(getAssets())
    Wait.time(function()
      if character["image-url"] and character["image-url"] ~= "" then
        self.UI.setAttributes("portrait", {
          image = "portrait-"..character["image-url"],
          color = "white"
        })
      end
    end, 0.4)
  end, 0.1)
end

function getAssets()
  if character["image-url"] and character["image-url"] ~= "" then
    return {
      {
        name = "portrait-"..character["image-url"],
        url = character["image-url"],
      }
    }
  end
  return {}
end
